async function () {
  GetState.run().then(data => {
    storeValue('coords', [data[0]['lat'], data[0]['lng']]);
    ReadZips.run().then(data => {
      var ids = [];
      var zips = [];
      for (const i in data) {
        const id = data[i]['place_id'];
        const zip = data[i]['postal_code'];
        ids.push(id);
        zips.push(zip);
      }
      storeValue('idRead', String(ids));
      storeValue('zipRead', String(zips));
      var ziplist = [];
      for (const i in ids) {
        var obj = {
          "postal_code": Number(zips[i]),
          "place_id": ids[i]
        };
        ziplist.push(obj);
      }
      storeValue('zipList', ziplist);
    });
  });
}

async function () {
  return GetUsr.run().then(data => {
    Object.keys(data[0]).map(key => storeValue(key, data[0][key]));
    if (appsmith.store.account_type == 'agent') {
      usrdetails.agentButton1();
    }
    if (appsmith.store.account_type == 'investor') {
      usrdetails.investorButton1();
    }
    if (appsmith.store.account_type == 'buyer') {
      usrdetails.buyerButton1();
    }
  });
}
